import React from 'react';

const Projects = () => {
  const projects = [
    {
      id: 1,
      title: '3D Portfolio',
      description: 'An interactive portfolio website built with React and Three.js featuring a 3D word cloud navigation.',
      technologies: ['React', 'Three.js', 'React Three Fiber', 'CSS3'],
      image: 'project1.jpg', // You would add actual images later
      link: '#'
    },
    {
      id: 2,
      title: 'E-Commerce Platform',
      description: 'A full-stack e-commerce application with product catalog, shopping cart, and payment processing.',
      technologies: ['React', 'Node.js', 'Express', 'MongoDB', 'Stripe API'],
      image: 'project2.jpg',
      link: '#'
    },
    {
      id: 3,
      title: 'Weather Dashboard',
      description: 'A weather application that displays current conditions and forecasts based on user location.',
      technologies: ['JavaScript', 'HTML5', 'CSS3', 'Weather API'],
      image: 'project3.jpg',
      link: '#'
    }
  ];

  return (
    <div className="page-content">
      <h1>Projects</h1>
      <p>Here are some of the projects I've worked on:</p>

      <div className="projects-container">
        {projects.map(project => (
          <div key={project.id} className="project-card">
            <div className="project-image">
              {/* In a real application, you would use actual images */}
              <div className="placeholder-image">{project.title[0]}</div>
            </div>
            <div className="project-details">
              <h2>{project.title}</h2>
              <p>{project.description}</p>
              <div className="project-tech">
                {project.technologies.map((tech, index) => (
                  <span key={index} className="tech-tag">{tech}</span>
                ))}
              </div>
              <a href={project.link} className="project-link" target="_blank" rel="noopener noreferrer">
                View Project
              </a>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Projects;
